import React from 'react';
import { MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';

export default class ViewUser extends Component{

  state = {
    values: [],
    isSet: false
  }

  render(){
    return (
      <div>
        {
          this.state.isSet
          ? (<div>
              <table class="table">
                <thead class="thead-light">
                  <tr>
                    <th scope="col">Name</th>
                    <th scope="col">NIC/Passport No</th>
                    <th scope="col">Vehical No</th>
                    <th scope="col">Cassis No</th>
                    <th scope="col">Agreement ID</th>
                    <th scope="col">Version</th>
                    <th scope="col">Created Date</th>
                  </tr>
                </thead>
                <tbody>
                  {users.map(user =><tr scope="row" key={user.userId}>
                      <td>{user.firstName}</td>
                      <td>{user.lastName}</td>
                      <td>{user.email}</td>
                      <td>{user.nic}</td>
                      <td>
                      {
                        user.isLock ?
                        <button type="button" onClick={() => this.changeState(user.userId, !user.isLock)} class="btn btn-success">Active</button> :
                        <button type="button" onClick={() => this.changeState(user.userId, !user.isLock)} class="btn btn-danger">Deactive</button>
                      }
                      </td>
                  </tr>
                  )}
                </tbody>
              </table>
              </div>
          ):
          (<div><h3>Loading</h3></div>)
          }
          </div>
    );
  }
}
